def proc(t2c_params):
    """

    :param t2c_params:
    :return:
    """
    stage_name = t2c_params.stage_name
    stage_index = t2c_params.stage_index

    if stage_name not in t2c_params.double_buffer_list:
        t2c_params.proc_flag_dict[stage_index] = True
        return True

    return True
